    function createScanner() {
    
      d3.select("#scanner")
      .append("rect")
      .attr("id", "scan")
      .attr("fill", "#fff")
      .attr("fill-opacity", "1")
      .attr("stroke-width", "0.5")
      .attr("stroke", "#fff")
      .attr("x", 0)
      .attr("y", 18.5)
      .attr("width", "0.6")
      .attr("height", "6")
      .style("filter", "url(#blur-scanner)") //TODO: effect futurist
      .style("opacity", "1")
    }
    
    function createHeartbeat() {
      d3.select("#scanner")
      .append("path")
      .attr("id", "heartbeat")
      .attr("stroke", "#fff")
      .attr("stroke-width", "0.1")
      .style("opacity", "1")
      .style("filter", "url(#blur-heartbeat)")
      .attr("transform", "translate(20,9) scale(0.6)")
    }
    
    function animateVeins() {
      var vein1 = d3.select("#vein1")
      var totalLength = vein1.node().getTotalLength();
      vein1
      .attr("stroke-dasharray", totalLength + " " + totalLength)
      .attr("stroke-dashoffset", totalLength)
      .attr("stroke-width", 0.2)
      .transition()
      .duration(3600)
      .ease("linear")
      .attr("stroke-dashoffset", 0)
      
      var vein2 = d3.select("#vein2")
      var totalLength2 = vein2.node().getTotalLength();
      vein2
      .attr("stroke-dasharray", totalLength2 + " " + totalLength2)
      .attr("stroke-dashoffset", totalLength2)
      .attr("stroke-width", 0.2)
      .transition()
      .ease("linear")
      .duration(3600)
      .attr("stroke-dashoffset", 0)
    }
    
    function animateScanner() {
      
      d3.select("#scan")
      .transition()
      .ease("linear")
      .duration(4000)
      .attr("x", 11.3)
      .transition()
      .duration(200)
      .style("opacity", "0")
      .each("end", function() {
        stopScanAnim = true
        stopHearbeat = true
        d3.select("#heartbeat")
        .transition()
        .duration(200)
        .style("opacity", "0")
        
        createKeys()
      });
    }
    
    var stopHearbeat = false
    function animateHeartbeat() {
      var heartbeat = d3.select("#heartbeat")
      heartbeat.attr("d", "M -30,10 L -25,10 L -24,8 L -23,15 L -22,3  L -21,12 L -20.5,10 L -18,10 L -17.7,9 L -17,12 L -16.8,8 L -16,11 L -15.8,10 L -13,10")
      var totalLength = heartbeat.node().getTotalLength();
      heartbeat.attr("stroke-dasharray", totalLength + " " + totalLength)
      .attr("stroke-dashoffset", totalLength)
      .transition()
      .duration(2000)
      .attr("stroke-dashoffset", 0)
      .each("end", function() {
        if (!stopHearbeat) {
          animateHeartbeat()
        }
      })
    }
    
